import React, { useState, useEffect } from "react";
import MyRecipeService from "../../services/myrecipe.service";
import "../style.css";

const MyRecipeHome = () => {
  return (
    <main>
      <div className="container py-4">
        <div className="container-fluid py-5">
          <MyRecipe/>
          <LikedRecipe/>
        </div>
      </div>
    </main>
  );
};

const Recipe = ({recipe}) => {
  const url = `/myrecipe/${recipe.id}`
  return(
    <div>
      <h5> 
        <a href={url}>{recipe.name}</a>
        <button className="btn btn-round" onClick={()=>{}}>
          <i className="bi bi-pencil-fill"></i>
        </button> 
      </h5>
    </div>
  );
};

const MyRecipe = () => {
  const [recipes, setRecipes] = useState([]);

  useEffect(() => {
    MyRecipeService.getAllRecipe()
    .then(({data}) => {
      setRecipes(data);
    })
    .catch((err) => {
      console.log(err)
    });
  }, [])

  return(
    <div>
      <h3>
        My Recipes
        <button className="btn btn-round" onClick={()=>{}}>
          <i className="bi bi-plus-lg"></i>
        </button> 
      </h3>
      {recipes.map((recipe, idx) => 
        <Recipe key={idx} recipe={recipe}/>
      )}
    </div>
  );
};

const LikedRecipe = () => {
  return(
    <div>
      <h3> Liked Recipes </h3>
    </div>
  );
};

export default MyRecipeHome;
